/* Function  structure for function  `getChildUser` */

/*!50003 DROP FUNCTION IF EXISTS `getChildUser` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`dtssyncwriter`@`%` FUNCTION `getChildUser`(
rootId INT(11)) RETURNS varchar(1000) CHARSET utf8
    SQL SECURITY INVOKER
BEGIN 
DECLARE sTemp VARCHAR(1000); 
DECLARE sTempChd VARCHAR(1000); 
SET sTemp = '$'; 
SET sTempChd =CAST(rootId AS CHAR); 
WHILE sTempChd IS NOT NULL DO 
SET sTemp = CONCAT(sTemp,',',sTempChd); 
SELECT GROUP_CONCAT(id) INTO sTempChd FROM sys_user WHERE FIND_IN_SET(parent_id,sTempChd)>0 and status=1; 
END WHILE; 
RETURN sTemp; 
END */$$
DELIMITER ;

/* Function  structure for function  `getChildUserRole` */

/*!50003 DROP FUNCTION IF EXISTS `getChildUserRole` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`dtssyncwriter`@`%` FUNCTION `getChildUserRole`(
rootId INT(11)) RETURNS varchar(1000) CHARSET utf8
    SQL SECURITY INVOKER
BEGIN 
DECLARE sTemp VARCHAR(1000); 
DECLARE sTempChd VARCHAR(1000); 
SET sTemp = '$'; 
SET sTempChd =CAST(rootId AS CHAR); 
WHILE sTempChd IS NOT NULL DO 
SET sTemp = CONCAT(sTemp,',',sTempChd); 
SELECT GROUP_CONCAT(id) INTO sTempChd FROM sys_role WHERE FIND_IN_SET(role_super,sTempChd)>0; 
END WHILE; 
RETURN sTemp; 
END */$$
DELIMITER ;

